import React from "react";
import './css/navbar.css';
const NavBar =()=>{
return(
    <div className="Navbar">
   <nav>
    <ul>
    <li> <a href="www.facebook.com">Home</a></li>
    <li><a href="">Contact</a></li>
    <li><a href="">Service</a></li>
    <li><a href="">About</a></li>
    </ul>
   </nav>
    </div>
)
}

export default NavBar;
